import './Expenses.css';
import ExpenseItem from './ExpenseItem';
import Card from '../UI/Card';
import ExpensesFilter from './ExpensesFilter';
import { useState } from 'react';

function Expenses(props){

    const [filteredYear, setFilteredYear] = useState('2020');

    const filterChangeHandler = (selectedYear) =>{
        setFilteredYear(selectedYear);
    }

    const filteredExpenses = props.items.filter(exp => {return exp.date.getFullYear().toString() == filteredYear});

    return(
        <div className="expenses">
            <ExpensesFilter selected={filteredYear} onChangeFilter={filterChangeHandler}/>
            {filteredExpenses.length === 0 ? (<p>No expenses found</p>) : (
                filteredExpenses.map((expense) => <ExpenseItem title = {expense.title} amount = {expense.amount} date = {expense.date} key={expense.id} />)
            )}
            
        </div>
    );
}

export default Expenses;
